  const [people, setPeople] = useState([
    {
      name:'sonny',
      url: ''
    },
    {
      name: 'mark',
      url: ''
    }
  ]);

  return (
    <div>
      <h1>Tinder cards</h1>
      {people.map(person => (
        <TinderCard>
          <div className="card">
            <h3></h3>
          </div>
        </TinderCard>
      ))}
    </div>
  )
}

export default TinderCards
